import React from 'react';
import PropTypes from 'prop-types';

function ResultTable({ results }) {
    return (
        <div className="result-table">
            <h2>Route Results</h2>
            {results.path && results.path.length > 0 ? (
                <table>
                    <thead>
                        <tr>
                            <th>Route</th>
                            <th>Distance (miles)</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            {/* Display path joined with arrows */}
                            <td>{results.path.join(' -> ')}</td>
                            {/* Display distance formatted to two decimal places */}
                            <td>{results.distance.toFixed(2)}</td>
                        </tr>
                    </tbody>
                </table>
            ) : (
                <p>No route found or path is empty.</p>
            )}
        </div>
    );
}

// Define PropTypes for validation
ResultTable.propTypes = {
    results: PropTypes.shape({
        path: PropTypes.arrayOf(PropTypes.string).isRequired,
        distance: PropTypes.number.isRequired,
    }).isRequired,
};

export default ResultTable;
